import React, { Component } from 'react';
import { Container } from 'semantic-ui-react';
import Sources from '../components/SourceList/Sources';

class Blog extends Component {
render() {
   return (
    <div>
     <Container >
    <div textAlign='left'>
    <Sources />
    </div>

    <div textAlign='center'>
    <Sources />
    </div>

    <div textAlign='Right'>
    <Sources />
    </div>
    </Container>
    </div>
        )
    }
}

export default Blog;
